INSERT INTO `tbl_post` VALUES (1,'Oracle JDeveloper provides you with a wide range of tools to develop the frontend or view layer of your Java EE applications.','2010-09-09 00:00:00',1),(2,'Save time by inserting pre-written code into source files instead of having to type it in manually. Templates can intelligently modify the inserted code to suit surrounding code. Use shortcuts to speed up the selection of the required template.','2010-09-09 00:00:00',1),(3,'Toggle between code and visual views using the splitter. To split the file horizontally, grab the splitter just above the vertical scroll bar on the upper right-hand side of the window and drag it downward. To split the file vertically, grab the splitter just to the right of the horizontal scroll bar on the lower right-hand side of the window and drag it left.','2010-09-09 00:00:00',1),(4,'The JSP/HTML Visual Editor is used for WYSIWYG editing of your web pages including JSP, JSF, facelets, and HTML pages.','2012-09-09 00:00:00',2),(5,'Lets you choose whether or not to see design affordances such as facet tables or extra container spacing. True hides affordances and shows the page as it appears at runtime.','2010-09-09 00:00:00',15),(6,'<span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">You can simply use the JavaScript&nbsp;</span><code style=\"color: rgb(51, 51, 51); font-size: 16px; font-family: Consolas, Monaco, Courier, monospace; background-color: rgb(241, 241, 241);\">location.reload()</code><span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">&nbsp;method to refresh or reloads the page. This method optionally accepts a Boolean parameter&nbsp;</span><code style=\"color: rgb(51, 51, 51); font-size: 16px; font-family: Consolas, Monaco, Courier, monospace; background-color: rgb(241, 241, 241);\">true</code><span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">&nbsp;or&nbsp;</span><code style=\"color: rgb(51, 51, 51); font-size: 16px; font-family: Consolas, Monaco, Courier, monospace; background-color: rgb(241, 241, 241);\">false</code><span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">. If the parameter&nbsp;</span><code style=\"color: rgb(51, 51, 51); font-size: 16px; font-family: Consolas, Monaco, Courier, monospace; background-color: rgb(241, 241, 241);\">true</code><span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">&nbsp;is specified, it causes the page to always be reloaded from the server. However, if it is&nbsp;</span><code style=\"color: rgb(51, 51, 51); font-size: 16px; font-family: Consolas, Monaco, Courier, monospace; background-color: rgb(241, 241, 241);\">false</code><span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px;\">&nbsp;(which is default) or not specified, the browser may reload the page from its cache.</span>','2019-01-27 00:00:00',2),(7,'<span style=\"color: rgb(65, 65, 65); font-family: &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 17px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">There are no hard and fast rules regarding the length of title and meta description tags. However, the recommended length of title is somewhere between 65 to 70 characters including spaces, because more than this likely to be truncated in the search results. So try to keep the title length to 65 characters including spaces for best possible rendering. You can go up to 70 characters in total, but try not to exceed this.</span>','2019-01-27 00:00:00',10);
